export default function About() {
  return (
    <section id="about" className="bg-white py-20 px-6 md:px-20">
      <h2 className="text-3xl font-bold text-center text-blue-600 mb-6">
        About Me
      </h2>
      <p className="text-lg max-w-3xl mx-auto text-gray-700 text-center">
        I'm a passionate web developer who enjoys building clean, functional,
        and user-friendly websites. I work with technologies like{" "}
        <strong>React</strong>, <strong>Tailwind CSS</strong>, and{" "}
        <strong>JavaScript</strong>. I love solving problems and bringing ideas
        to life on the web.
      </p>
    </section>
  );
}
